import MyNotes from'./screens/MyNotes/MyNotes';

const App = () => (
 <BrowserRouter>
  <Header/>
    <main  >
   <Route path='/' component={LandingPage} exact/>
   <Route path='/mynotes' component={MyNotes}>

   </Route>
    </main>

  <Footer/>
  </BrowserRouter>




)


export default App;
